webpackJsonp([0x3b4f729d3a50d200],{"./node_modules/json-loader/index.js!./.cache/json/python-list-extend-method.json":function(e,t){e.exports={data:{markdownRemark:{html:'<h2>List Extend Method</h2>\n<p>There are many methods for lists, you can explore all of them by typing <code>help(list)</code> in your python console.\nOne of them is the extend function which, as the name says extends the list by adding all items of a list (passed as an argument) to the end.</p>\n<h4>Example Usage</h4>\n<div class="gatsby-highlight">\n      <pre class="language-py"><code>cities = ["San Francisco", "Los Angeles", "New York"]\ncities_in_texas = ["San Antonio", "Austin", "Dallas"]\ncities.extend(cities_in_texas)\nprint(cities)</code></pre>\n      </div>\n<h4>Output</h4>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>["San Francisco", "Los Angeles", "New York", "San Antonio", "Austin", "Dallas"]</code></pre>\n      </div>\n<h4>More Information:</h4>\n<p>The official documentation for <code>extend()</code> can be found <a href=\'https://docs.python.org/3.6/tutorial/datastructures.html\' target=\'_blank\' rel=\'nofollow\'>here</a></p>',fields:{slug:"/python/list-extend-method/"},frontmatter:{title:"List Extend Method"}}},pathContext:{slug:"/python/list-extend-method/"}}}});
